-- MATCH LICENSE NUMBERS WITH EXISTING ONES IN OSIS
-- OSIS.AGENT had to be copied over from DB3 to jburke.AGENT because OSIS tables are not availabe on server I'm using

update jburke.PROSPECT_LIST2
join (select AGENT_LIC_NUM1 from jburke.AGENT WHERE IFNULL(AGENT_LIC_NUM1,'') <> ''
UNION
select AGENT_LIC_NUM2 from jburke.AGENT WHERE IFNULL(AGENT_LIC_NUM2,'') <> ''
UNION
select AGENT_LIC_NUM3 from jburke.AGENT WHERE IFNULL(AGENT_LIC_NUM3,'') <> ''
UNION
select AGENT_LIC_NUM4 from jburke.AGENT WHERE IFNULL(AGENT_LIC_NUM4,'') <> ''
UNION
select AGENT_LIC_NUM5 from jburke.AGENT WHERE IFNULL(AGENT_LIC_NUM5,'') <> '') b on LICENSE_NUM = AGENT_LIC_NUM1
SET WINDHAVEN = 'Y';

SELECT * FROM (SELECT concat_ws('|',ZIP, substring_index(ADDRESS,' ',1)) as PROSPECT_KEY,
substring_index(cast(group_concat(LAST_NAME ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS LAST_NAME,
substring_index(cast(group_concat(FIRST_NAME ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS FIRST_NAME,
substring_index(cast(group_concat(FULL_NAME ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS FULL_NAME,
substring_index(cast(group_concat(LICENSE_NUM ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS LICENSE_NUM,
substring_index(cast(group_concat(AGENCY_NAME ORDER BY CASE WHEN IFNULL(TRIM(AGENCY_NAME),'') = '' THEN 1 ELSE 0 END ASC,
	ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS AGENCY_NAME,
substring_index(cast(group_concat(ADDRESS ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS ADDRESS,
substring_index(cast(group_concat(CITY ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS CITY,
substring_index(cast(group_concat(STATE ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS STATE,
substring_index(cast(group_concat(ZIP ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS ZIP,
substring_index(cast(group_concat(COUNTY ORDER BY ADDRESS ASC SEPARATOR '|') AS CHAR),'|',1) AS COUNTY,
IF(COUNT(CASE WHEN WINDHAVEN = 'Y' THEN 1 END) > 0,'Y','N') AS WINDHAVEN,
IF(COUNT(CASE WHEN PROGRESSIVE = 'Y' THEN 1 END) > 0,'Y','N') AS PROGRESSIVE,
IF(COUNT(CASE WHEN INFINITY = 'Y' THEN 1 END) > 0,'Y','N') AS INFINITY,
IF(COUNT(CASE WHEN FOREMOST = 'Y' THEN 1 END) > 0,'Y','N') AS FOREMOST,
IF(COUNT(CASE WHEN GAINSCO = 'Y' THEN 1 END) > 0,'Y','N') AS GAINSCO,
IF(COUNT(CASE WHEN ASSURANCE = 'Y' THEN 1 END) > 0,'Y','N') AS ASSURANCE,
IF(COUNT(CASE WHEN OCEAN_HARBOR = 'Y' THEN 1 END) > 0,'Y','N') AS OCEAN_HARBOR,
IF(COUNT(CASE WHEN RESPONSIVE = 'Y' THEN 1 END) > 0,'Y','N') AS RESPONSIVE,
IF(COUNT(CASE WHEN DAIRYLAND = 'Y' THEN 1 END) > 0,'Y','N') AS DAIRYLAND

from jburke.PROSPECT_LIST2

group by 1
having count(case when WINDHAVEN = 'Y' then 1 end) = 0) bvv WHERE TRIM(AGENCY_NAME) <> '';